import React, {Component} from 'react';

class PirateForm extends Component{
  constructor(props){
    super(props);
  }


  render(){
    if(this.props.ships === 0){
      return <p>Loading...</p>
    }
    return "I'm the form"
  }
}


export default PirateForm;
